package gcom.gui.atendimentopublico;import org.apache.struts.validator.ValidatorActionForm;public class GerarCertidaoNegativaActionForm extends ValidatorActionForm {	private static final long serialVersionUID = 1L;	private String idImovel;	private String matriculaImovel;	private String enderecoImovel;	private String cpfCnpj;	private String nomeClienteUsuario;	public String getIdImovel() {		return idImovel;	}	public void setIdImovel(String idImovel) {		this.idImovel = idImovel;	}	public String getMatriculaImovel() {		return matriculaImovel;	}	public void setMatriculaImovel(String matriculaImovel) {		this.matriculaImovel = matriculaImovel;	}	public String getEnderecoImovel() {		return enderecoImovel;	}	public void setEnderecoImovel(String enderecoImovel) {		this.enderecoImovel = enderecoImovel;	}	public String getCpfCnpj() {		return cpfCnpj;	}	public void setCpfCnpj(String cpfCnpj) {		this.cpfCnpj = cpfCnpj;	}	public String getNomeClienteUsuario() {		return nomeClienteUsuario;	}	public void setNomeClienteUsuario(String nomeClienteUsuario) {		this.nomeClienteUsuario = nomeClienteUsuario;	}}